import React, { useEffect, useState } from "react";
import { connect } from "react-redux";
import { Link } from "react-router-dom";
import HeaderComponent from "./HeaderComponent";
import { getLiveAuctionListAction } from '../Redux/Actions/Actions'

function UserProfileController(props) {

    const [liveAuctioList, setLiveAuctionList] = useState([]);

    useEffect(() => {
        props.getLiveAuctionList()
    }, [])

    useEffect(() => {
        if (props.liveAuctionList?.auction) {
            setLiveAuctionList(props.liveAuctionList.auction)
        }
    }, [props.liveAuctionList])

    console.log(liveAuctioList)


    return (
        <>
            <HeaderComponent />
            <div className="border-light card shadow " id="tabs-icons-text-2" role="tabpanel"
                aria-labelledby="tabs-icons-text-2-tab">
                <div className="p-0 m-2">
                    <div className="alert bg-primary d-flex justify-content-between p-2" role="alert">

                        <span className="h5 m-0">User Detaisl</span>
                        <div className="dropdown">
                            <button className="btn btn-secondary btn-sm  dropdown-toggle" type="button" id="dropdownMenuButton"
                                data-toggle="dropdown" aria-haspopup="true" aria-expanded="false">
                                Select Auction
                            </button>
                            <div className="dropdown-menu" aria-labelledby="dropdownMenuButton">
                                <option className="dropdown-item p-2" >COATED BY JSW-COATED - 20 Live Lots</option>
                                <option className="dropdown-item p-2" >COATED BY JSW-COATED - 20 Live Lots</option>
                                <option className="dropdown-item p-2" >COATED BY JSW-COATED - 20 Live Lots</option>
                            </div>
                        </div>
                    </div>
                    <div className="card ">
                        <div className="card-header bg-light h6 d-flex justify-content-between ">
                            <span className="card-title m-0">COATED BY JSW Live Lots Qty : 600</span>
                            <button type="button" className="btn btn-sm btn-success btn-tooltip" data-animation="true">Download To
                                Excel</button>
                        </div>


                        <div className="card-body p-0">
                           
                        </div>

                        <br />
                        <hr />

                       
                    </div>
                </div>
            </div>
        </>)

}


const mapStateToProps = (state) => {
    return {
        liveAuctionList: state.getLiveAuctionListAction.liveAuctionList,
    }
}
const mapDispatchtoProps = {
    getLiveAuctionList: () => getLiveAuctionListAction(),
}
export default connect(mapStateToProps, mapDispatchtoProps)(UserProfileController)
